function App() { 
  let [zetaVerseData, setZetaVerseData] = useState([]);

  useEffect(() => {
    const fetchMyNfts = async () => {
      try {
        const response = await axios.get('https://testnets-api.opensea.io/assets', {
          params: {
            asset_contract_address: '0x01df5ae7Ee67a583116De8ff53f6954871784FD4',
            order_direction: 'asc'
          },
          headers: {
            'x-api-key': 'YOUR_API_KEY'
          }
        });
        setZetaVerseData(response.data.assets);
      } catch (error) {
        console.error(error);
      }
    }
    fetchMyNfts();
  }, []);

  return (
    <div className='app'>
    <Header />
      {zetaVerseData.map((data, index) => (
        <CollectionCard 
          key={index}
          id={index} 
          name={data.name} 
          traits={data.traits} 
          image={data.image}
        />
      ))}
    </div>
  )
}


export default App;
